import { BrowserRouter as Router, Switch, Route, Link, NavLink } from 'react-router-dom'
// import { ContainerMaxWidth } from '../components/ContainerMaxWidth/ContainerMaxWidth';
// import { Header } from './Header/Header';
import { ProductList } from '../ProductList/ProductList';
import { FavoritePage } from './FavoritePage';
import { CartPage } from './CartPage';
import { ShopPage } from './ShopPage';
import { ContainerMaxWidth } from '../ContainerMaxWidth/ContainerMaxWidth';
import Header from '../Header/Header';


export function MainPage() {
    return (
        <div>
            <Header />
            <div className="Menu">
                <Link className="MenuItems" to="/">HOME</Link>
                <Link className="MenuItems" to="/shop">SHOP</Link>
                <Link className="MenuItems" to="/favorite">FAVORITE</Link>
                <Link className="MenuItems" to="/cart">CART</Link>
            </div>
            <Switch>
                <Route exact path="/" ></Route>
                <Route path="/shop"><ShopPage /></Route>
                <Route path="/favorite"><FavoritePage /></Route>
                <Route path="/cart"><CartPage /></Route>
            </Switch>

            <ContainerMaxWidth />
            <ProductList />
        </div>
    );
}
